import React from 'react';
import { Link } from 'react-router-dom';

const BookCard = ({ book }) => (
  <div>
    <Link to={`/books/${book._id}`}>
      <h4>{book.title}</h4>
      <p>{book.author}</p>
    </Link>
  </div>
);
export default BookCard;
